import React, { useState, useEffect } from "react";
import "./Players.css";
import messilogo from './messi.png';

const Players = () => {
  // State to hold players data
  const [players, setPlayers] = useState([]);

  // Example data fetch simulation
  useEffect(() => {
    // Simulate fetching data from the database
    const fetchData = async () => {
      const data = [
        {
          id: 1,
          name: "Lionel Messi",
          club: "Inter Miami",
          nationality: "Argentina",
          position: "AMR",
          rating: 94,
          contractUntil: "12-2025",
          wage: "€368K p/w",
          image: messilogo, // Replace with real image URL
        },
        {
          id: 2,
          name: "Erling Haaland",
          club: "Manchester City",
          nationality: "Norway",
          position: "ST",
          rating: 93,
          contractUntil: "06-2027",
          wage: "€398K p/w",
          image: "https://path/to/haaland.jpg", // Replace with real image URL
        },
        {
          id: 3,
          name: "Generic Player",
          club: "Unknown Club",
          nationality: "Unknown",
          position: "DC",
          rating: 85,
          contractUntil: "06-2025",
          wage: "€50K p/w",
          image: null, // No image
        },
      ];
      setPlayers(data);
    };

    fetchData();
  }, []);

  return (
    <div className="players-page">
      {/* Sidebar for filters */}
      <aside className="players-sidebar">
        <h2>Filters</h2>
        <div className="filter-group">
          <label>Name</label>
          <input type="text" placeholder="Name" />
        </div>
        <div className="filter-group">
          <label>Club</label>
          <input type="text" placeholder="Club" />
        </div>
        <div className="filter-group">
          <label>Nationality</label>
          <input type="text" placeholder="Nationality" />
        </div>
        <div className="filter-group">
          <label>League</label>
          <input type="text" placeholder="League" />
        </div>
        <div className="filter-group">
          <label>Smart Filters</label>
          <div>
            <input type="checkbox" id="wonderkids" />
            <label htmlFor="wonderkids">Wonderkids</label>
          </div>
          <div>
            <input type="checkbox" id="contract-expiring" />
            <label htmlFor="contract-expiring">Contract expiring</label>
          </div>
        </div>
      </aside>

      {/* Main content for players */}
      <main className="players-list">
        <h1>Players</h1>
        <table>
          <thead>
            <tr>
              <th>Photo</th>
              <th>Name</th>
              <th>Club</th>
              <th>Position</th>
              <th>Rating</th>
              <th>Wage</th>
              <th>Contract</th>
            </tr>
          </thead>
          <tbody>
            {players.map((player) => (
              <tr key={player.id}>
                <td>
                  {player.image ? (
                    <img
                      src={player.image}
                      alt={player.name}
                      className="player-photo"
                    />
                  ) : (
                    <div className="placeholder-photo">No Image</div>
                  )}
                </td>
                <td>{player.name}</td>
                <td>{player.club}</td>
                <td>{player.position}</td>
                <td>{player.rating}</td>
                <td>{player.wage}</td>
                <td>{player.contractUntil}</td>
              </tr>
            ))}
          </tbody>
        </table>
      </main>
    </div>
  );
};

export default Players;
